import axios from 'axios';

const fetchStatesByCountry = async (countryCode) => {
  try {
    var headers = new Headers();
    headers.append("X-CSCAPI-KEY", "VHpUb0p0djBVWkZFODRGbTBxZFMzWjYxY2s1MDhrV2c3N0ZvT3IwaA==");

    var requestOptions = {
    method: 'GET',
    headers: headers,
    redirect: 'follow'
    };

    fetch(`https://api.countrystatecity.in/v1/countries/${countryCode}/states`, requestOptions)
    .then(response => response.json())
    .then(result => console.log(result))
    .catch(error => console.log('error', error));
    return 1;
  } catch (error) {
    console.error('Erro ao buscar estados:', error);
    return [];
  }
};

export default fetchStatesByCountry;
